column8:
オリジナルデザインのスマホピアスで、訓練をつんだ職人だけで製造しています。うさぎは25年ぐらい前に生産を終了したスワロフスキーの幻の雪うさぎです。雪うさぎはスワロの本社（オーストリア）にも在庫がなく、専門家でも後世界に何個残っているのか分らないというぐらいのレアな商品となります。
使用している天然石はローズクォーツ2個、ムーンストーン、アメジスト、ライトアメジスト、レインボークリスタル、ブルークリスタルです。雪うさぎの上の方はフック（留め金）になっているので、外してチャームとしても使えます。ファスナー全般、バックチャーム、携帯ゲーム、財布、ペン入れ、デジカメケースなど、引っ掛ける場所があれば色々なものに、誰でも簡単に取り付け可能です。
<br><br>ローズクォーツ<br>
“愛とやさしさの象徴”とされ、女性の内なる美しさを輝かせてくれる石。現在、女性からの絶大なる人気を博している石で、身につけることで女性らしい輝きをふたたびもたらしてくれるでしょう。そのパワーは、この石が《恋愛成就》に素晴らしい効果を発揮する。また、癒しのエネルギーにもあふれていますので、失恋したハートにはふたたび新たな愛へと向かわせるパワーを与えてくれます。
<br><br>ムーンストーン<br>
神秘的な力を秘めた石として人々に愛され、女性をサポートしてくれる力にあふれています。波立った感情を穏やかに鎮め、平和なハートを持ち続けることができるでしょう。『恋人たちの石』『愛を伝える石』とも言われ、持ち主を優しく大らかな愛情で満たしてくれるといわれています。愛する人との出会いと恋愛を成就させ、幸せな結婚そして家庭へと導いてくれるでしょう。
<br><br>アメジスト（ライトアメジスト）<br>
『愛の守護石』『真実の愛を守りぬく石』とされるアメジスト。真実の愛を守るパワーを与えてくれるといわれています。恋愛成就に大きくサポートしてくれる素敵なパワーストーンといえるでしょう。恋の熱情以外にも、ストレスで疲れた心を癒し、落ち着かせ、穏やかな安らぎを与えてくれるといわれる、スピリチュアルパワーの強い石のひとつでもあります。ヒーリング効果が非常に強く、ネガティブになりがちな方にはポジティブな癒しを。ハートが傷ついてしまった人には、やすらぎのエネルギーを与えてくれるでしょう。
<br><br>クリスタル（ブルー・レインボー）<br>
ネガティブなエネルギーに対し水が流れるかのごとく浄化し、クリアに整える強力なヒーリング作用をもち、石はもちろん、さまざまなものごとを調和し統合させより高次元へと導いてくれます。エネルギーを増幅させる力にも優れ、集中力と直観力を強化し霊的世界との結びつきを高めるサポートをしてくれます。
<br><br>スマートフォンのイヤフォンジャック（直径3.5ミリ）に付けられるスマホピアスです。iPad、iPhone、iPod等にも付けられます。

<hr>
【サイズ・容量】<br>
スマートフォンピアス全長：約10.5cm、重さ約11.7ｇ、雪うさぎ：約18cm</font><br>
【素材】<br>スワロフスキー、天然石（ローズクォーツ×2個、ムーンストーン、アメジスト、ライトアメジスト、ブルークリスタル、レインボークリスタル）</font><br>
