煌きのサクラをいつでもあなたのそばに…☆ 透き通るキラメキが、あなたのもとへ舞い降りる…。日本の美「桜」をイメージした華やぎ春モデル！透き通るキラメキはいつでもピュアな気分に。スワロフスキーを6つも使用し、さわやかな美しさと春らしい新鮮な華やぎ♪スワロフスキーとイヤホンジャックを繋ぐ箇所も全てスワロフスキーを使用！美しいデザインが春のみならず季節を問わない煌きを生み、癒されます。あなたのもとへピュアなスワロフスキーサクラを！スマートフォンピアスを装着することによってただオシャレになるというだけでなくゴミや埃のイヤホンジャックへの侵入をを防ぎます。多数のカラーで、自分だけの気に入った色を選ぶことが出来ます。さらに！さらに！当店オリジナルスマートフォンケースのプラスエス【Plus-S】と合わせるとよりオシャレ度がアップします。繊細すぎる作り方によって生み出される独自の美しい輝きはどんなスタイルにも合いスマートフォンをグッと華やかにします。プレゼントやペアでお使いになられるにも最適なデザインです。

<hr>
